import React from 'react';

function Navbar({ title, icon }) {
  return (
    <div className='navbar bg-dark'>
      <h1>
        <i className={icon}></i>
        {title}
      </h1>
    </div>
  );
}

Navbar.defaultProps = {
  title: 'Steadfast API',
  icon: 'fas fa-id-card-alt',
};

export default Navbar;
